import React from 'react';
import {sum,sub,mult,div} from './Calc';
 function App(){
return (
    <>
    <ul>
        <li>Sum = {sum(40,4)}</li>
        <li>Subtract = {sub(40,4)}</li>
        <li>Mult = {mult(40,4)}</li>
        <li>Div = {div(40,4)}</li>
    </ul>
    </>
);
 }

 export default App;
